        return(
            <span className="nickname">
                <i class="far fa-user"></i>
                {this.props.nickname}</span>
        )

    }else{  
        return(
            <React.Fragment>
            <a href="/" className="">Login</a>
            <a href="/" className="">Register</a>
            </React.Fragment>

        )
    }
}



    render(){
